import React from 'react'
import './Link.style.css'
export default function Link({ url ,  title }) {
    return (
        <div>
            <a
          className="App-link"
          href={url}
          target="_blank"
          rel="noopener noreferrer"
        >
          {title}
        </a>
        </div>
    )
}
